package KEGGMODULE;

=head1 Subroutines
=cut
=over 12

=item %HoH = KO_HOH():

   Every KO is the first Key in the hash. It points to another hash with 4 additional keys: "EC","LevelOne","LevelTwo", and "PathwayNum". Each of the values here is the 1 or more annotations assigned to the KO. In the event that there is more than 1 annotation, the annotations are separated by a colon.

   Example:
   $HoH{'K00001'}{'EC'} = "EC1.1.1.1",
   $HoH{'K00001'}{'LevelOne'} = "Metabolism",
   $HoH{'K00001'}{'LevelTwo'} = "Carbohydrate Metabolism:Lipid Metabolism:Amino Acid Metabolism:Metabolism of Cofactors and Vitamins:Xenobiotics Biodegradation and Metabolism",
   $HoH{'K00001'}{'PathwayNum'} = "ko00010:ko00071:ko00350:ko00830:ko00625:ko00626:ko00980:ko00982"

=cut

=item %Hash = PathwayNum_to_Name();

   Each pathway number is stored as key, pointing the name of the pathway as value.

   Example: "ko01100" => "Metabolic pathways"

=cut
